	PROOF_OF_ORIGIN_SESSION_TOKEN_CONTENT_BINDING_TYPE_VISITOR_DATA = 1;
	PROOF_OF_ORIGIN_SESSION_TOKEN_CONTENT_BINDING_TYPE_USER_SIGNED_IN = 2;
